        <div className = "containerL">
            <div className = "spaceL">
                <h2>Laboratorios</h2>
                <BotonLabs/>
                <BotonLabs/>
                <BotonLabs/>
            </div>
            <div>
                <NextEvent/>
                <NextEvent/>
            </div>
            
        </div>
    );
}

